- Поліпшено роботу Push-сповіщень. Тепер всі повідомлення будуть з'являтись у додатку ще до його безпосереднього запуску.
- Проведена оптимізація синхронізації даних із сервером.
- Розширено функціонал по роботі з повідомленнями, додана функція "Multiselect".
- Змінено максимальну довжину текстового та зашифрованого повідомлень.

Усунені наступні проблеми та недоліки:
  - Некоректна робота функції "Пошук" серед учасників в групових чатах;
  - Некоректна робота функції "IsTyping ...";
  - Виправлені незначні помилки при установці паролю в додатку;
  - Низька якість надісланих зображень.

Виправлення інших помилок, підвищення стабільності роботи додатку.

